import React, { useState, useEffect } from 'react';
import { fetchStockData } from '../../api/stockApi';

const StockInfoPanel = ({ selectedStock, stocks }) => {
  const [stockDetails, setStockDetails] = useState(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (selectedStock) {
      const fetchDetails = async () => {
        setLoading(true);
        try {
          const details = await fetchStockData(selectedStock.symbol);
          setStockDetails(details);
        } catch (error) {
          console.error("Failed to fetch stock details:", error);
          // Fallback to basic data if API fails
          setStockDetails({
            ...selectedStock,
            peRatio: 'N/A',
            marketCap: 'N/A',
            dividend: 'N/A'
          });
        }
        setLoading(false);
      };
      fetchDetails();
    }
  }, [selectedStock]);

  if (!selectedStock) {
    return (
      <div className="stock-info-panel">
        <h3>Stock Information</h3>
        <div className="no-selection">
          <p>Click on a stock in the visualization to see details</p>
        </div>
      </div>
    );
  }

  const formatMarketCap = (value) => {
    if (typeof value !== 'number') return value;
    if (value >= 1e12) return `$${(value / 1e12).toFixed(2)}T`;
    if (value >= 1e9) return `$${(value / 1e9).toFixed(2)}B`;
    if (value >= 1e6) return `$${(value / 1e6).toFixed(2)}M`;
    return `$${value.toFixed(2)}`;
  };

  return (
    <div className="stock-info-panel">
      <h3>Stock Information</h3>
      
      <div className="stock-header">
        <h4>{selectedStock.symbol}</h4>
        <span className={`price ${selectedStock.change >= 0 ? 'positive' : 'negative'}`}>
          ${selectedStock.price.toFixed(2)}
        </span>
      </div>

      {loading ? (
        <div className="loading">Loading details...</div>
      ) : (
        <div className="stock-details-grid">
          <div className="detail-item">
            <span className="detail-label">Change:</span>
            <span className={`detail-value ${selectedStock.change >= 0 ? 'positive' : 'negative'}`}>
              {selectedStock.change >= 0 ? '+' : ''}{selectedStock.change.toFixed(2)} ({selectedStock.changePercent})
            </span>
          </div>

          <div className="detail-item">
            <span className="detail-label">Volume:</span>
            <span className="detail-value">
              {(selectedStock.volume / 1000000).toFixed(2)}M
            </span>
          </div>

          {stockDetails && (
            <>
              <div className="detail-item">
                <span className="detail-label">Market Cap:</span>
                <span className="detail-value">
                  {formatMarketCap(stockDetails.marketCap)}
                </span>
              </div>

              <div className="detail-item">
                <span className="detail-label">P/E Ratio:</span>
                <span className="detail-value">
                  {stockDetails.peRatio}
                </span>
              </div>

              <div className="detail-item">
                <span className="detail-label">Dividend Yield:</span>
                <span className="detail-value">
                  {stockDetails.dividend || 'N/A'}
                </span>
              </div>

              <div className="detail-item full-width">
                <span className="detail-label">Sector:</span>
                <span className="detail-value">
                  {stockDetails.sector || 'N/A'}
                </span>
              </div>
            </>
          )}
        </div>
      )}
    </div>
  );
};

export default StockInfoPanel;
